    dateOnSaleTo?: Maybe<Scalars['String']>;
    /** Product description */
    description?: Maybe<Scalars['String']>;
    /** The desired slug of the post */
    desiredSlug?: Maybe<Scalars['String']>;
    /** Download expiry */
