    stockStatus?: Maybe<WpStockStatusEnum>;
    /** Product variation tax class */
    taxClass?: Maybe<WpTaxClassEnum>;
    /** Tax status */
    taxStatus?: Maybe<WpTaxStatusEnum>;
    /** The template assigned to a node of content */
    template?: Maybe<WpContentTemplate>;
    /** Product type */
    type?: Maybe<WpProductTypesEnum>;
    /** The unique resource identifier path */
    uri?: Maybe<Scalars['String']>;
    /** Is product virtual? */
    virtual?: Maybe<Scalars['Boolean']>;
    /** Connection between the ProductVariation type and the visibleProduct type */
    visibleProducts?: Maybe<WpProductVariationToVisibleProductConnection>;
    /** Product variation weight */
